import SignUpPage from './SignUpPage';


function App() {
  return (
    <AuthProvider className="App">
      <HashRouter>
        <Switch>  
          <ShoppingPage />


        </Switch>
      </HashRouter>

    </AuthProvider>

  );
}

export default app;
